import React from 'react';

import './EventItem.css';

const EventItem = props => {
	return (
		<li className='event-item'>
			<div className='event-item__content'>
				<div className='event-item__image'>
					<image src={props.image} />
				</div>
			</div>
		</li>
	);
};

export default EventItem;
